    {
        sno : 1,
        title : "Do Home Work",
        des: "FAFL"

    },
    {
        sno : 1,
        title : "Go to Market",
        des: "Fewkl"

    },
    {
        sno : 1,
        title : "Wash Clothes",
        des: "Fdfsdf"

    }
]
  return (
    <>
    <Header title="MY TodoList App" searchBar={false}/>
    <Todos todos = {todos}/>
    <Footer/>

    </>
  )
}

export default App;
